import React from "react";

 const AllPuppies = (props) => {
    console.log(props);
    return (
        <div>
            <h2>this works brother</h2>
            {  
            props.puppies.map ((puppy) => {
                let pupImg = puppy.imgUrl
                return (
                    <div key={puppy.id}>
                        <h2>this puppy is {puppy.name}</h2>
                        <img src= '${pupImg}'></img>
                    </div>
                );
            })
            }


        </div>
    );
}

export default AllPuppies

